package cn.com.phinfo.protocol;import java.util.List;import java.util.Stack;import com.heqifuhou.protocolbase.HttpResultBeanBase;import com.heqifuhou.protocolbase.QuickRunObjectBase;public class ProcessSearchListRun extends QuickRunObjectBase {	public ProcessSearchListRun(String folderid){		this(folderid,"");	}	public ProcessSearchListRun(String folderid,String search) {		super(LURLInterface.GET_URL_PROCESS_SEARCH(folderid,search),null,ProcessSearchResultBean.class);	}	public static class ProcessSearchResultBean extends HttpResultBeanBase{		private List<ProcessSearchItem> listData = new Stack<ProcessSearchItem>();		private int rowsPerPage;		private int page;		public List<ProcessSearchItem> getListData() {			return listData;		}		public void setListData(List<ProcessSearchItem> listData) {			this.listData = listData;		}		public int getRowsPerPage() {			return rowsPerPage;		}		public void setRowsPerPage(int rowsPerPage) {			this.rowsPerPage = rowsPerPage;		}		public int getPage() {			return page;		}		public void setPage(int page) {			this.page = page;		}	}	public static class ProcessSearchItem{		private String processId;		private String name;		private String priority;		private String createdOn;		private String createdBy;		private String createdByName;		public String getProcessId() {			return processId;		}		public void setProcessId(String processId) {			this.processId = processId;		}		public String getName() {			return name;		}		public void setName(String name) {			this.name = name;		}		public String getPriority() {			return priority;		}		public void setPriority(String priority) {			this.priority = priority;		}		public String getCreatedOn() {			return createdOn;		}		public void setCreatedOn(String createdOn) {			this.createdOn = createdOn;		}		public String getCreatedBy() {			return createdBy;		}		public void setCreatedBy(String createdBy) {			this.createdBy = createdBy;		}		public String getCreatedByName() {			return createdByName;		}		public void setCreatedByName(String createdByName) {			this.createdByName = createdByName;		}	}}